import React, {Component} from 'react';

async function fetch_query()
    {
        let res

        res = await fetch(this.state.query)

        let results = res.json()
        console.log(results)
    }

class Listing extends Component {
    constructor(props) {
        super(props);
        this.state = { query : 'https://www.breakingbadapi.com/api/characters?limit=10' }
    }
    render() { 

        return ;
    }
}
 
export default Listing;
